import React, {useState} from 'react'
import "./App.css";



export default function App() {
  const [counter, setCounter] = useState(2);
  return (
    <div className='App'>
      <h1 onClick={()=>setCounter(counter+1)}>{counter}</h1>
    </div>
  );
}
